import React, { useState } from 'react';

export default function RegistrationPage() {

  // new Date() creates a Date object for the current date/time.
  // toISOString() converts it to an ISO string: "2025-12-10T14:32:18.123Z".
  // split("T") separates the date and time into ["2025-12-10", "14:32:18.123Z"].
  // [0] selects only the date part ("2025-12-10").
  const today = new Date().toISOString().split('T')[0];

  const [formData, setformData] = useState({
    participantName: '',
    orgName: '',
    designation: '',
    emailID: '',
    phoneNumber: '',
    eventName: '',
    eventID: '',
    eventDate: '',
    eventOrganizer: ''
  });

  async function handleSubmit (event){
    // Prevents the browser from refreshing the page when the form is submitted.
    // This keeps the React state intact and lets us handle the submission manually.
    event.preventDefault();

    const registrationInfo = {...formData};

    console.log('Form submitted:', registrationInfo);
    localStorage.setItem('registrationInfo', JSON.stringify(registrationInfo));
  }

  // Handle input changes dynamically:
  // 1. event.target.id gives the input's ID (e.g., "email" or "password").
  // 2. event.target.value is what the user typed.
  // 3. ...formData keeps the existing form data.
  // 4. [event.target.id]: event.target.value updates only that specific field.
  function handleChange(event){
    setformData({
      ...formData,
      [event.target.id]: event.target.value
    });
  }

  return (
    <div>
      <form onSubmit = {handleSubmit}>
        <label> Name of the Participant: </label>
        <input type = 'text' id = 'participantName'  placeholder = 'Participant Name' value = {formData.participantName} onChange = {handleChange} required/> <br/><br/>
        
        <label> Name of the Organization: </label>
        <input type = 'text' id = 'orgName' placeholder = 'Organization' value = {formData.orgName} onChange = {handleChange}  required/> <br/><br/>
        
        <label> Designation of the Participant: </label>
        <input type = 'text' id = 'designation' placeholder = 'Designation' value = {formData.designation} onChange = {handleChange} required/> <br/><br/>
        
        <label> Email Address of the Participant: </label>
        <input type = 'email' id = 'emailID' placeholder = 'youremail@abc.com' value = {formData.emailID} onChange = {handleChange} required/> <br/><br/>
        
        <label> Phone Number of the Participant: </label>
        <input type = 'text' id = 'phoneNumber' placeholder = '1234567890' value = {formData.phoneNumber} minLength = {10} onChange = {handleChange} required/> <br/><br/>
        
        <label> Name of the Event: </label>
        <input type = 'text' id = 'eventName' placeholder = 'Co-Pilot Seminar,Database Seminar,....' value = {formData.eventName} onChange = {handleChange} required/> <br/><br/>
        
        <label> ID of the Event: </label>
        <input type = 'text' id = 'eventID' pattern="[a-zA-Z0-9]+" placeholder = 'Must be alphanumeric' value = {formData.eventID} onChange = {handleChange}  required/> <br/><br/>
        xx  
        <label> Date of the Event: </label>
        <input type = 'date' min = {today} id = 'eventDate' onChange = {handleChange} required/> <br/><br/>
        
        <label> Name of the Event Organiser: </label>
        <input type = 'text' id = 'eventOrganizer' placeholder = 'Microsoft, Oracle,....' value = {formData.eventOrganizer} onChange = {handleChange} required/> <br/><br/>

       <button type = 'submit' id = 'submitButton'> Submit </button>
      
      </form>
    </div>
  )
}
